import React from "react";

const TableBody = ({ items, columns }) => {
  return (
    <tbody>
      {items.map((item, ind) => {
        return (
          <tr key={ind}>
            <td>{item.title}</td>
            <td>{item.author_first_name}</td>
            <td>{item.author_second_name}</td>
            <td>{item.genre}</td>
            <td>{item.rate}</td>
          </tr>
        );
      })}
    </tbody>
  );
};

export default TableBody;
